import React from 'react';
import { Link } from "react-router-dom";

const List = ({todoCategory}) => {
    return (  
     
        <React.Fragment>
         
            {
              todoCategory.map(item => (
            <ul className="list-group" key={item._id}>
              <li className="list-group-item">{item.categoryTitle}</li>   
            </ul>
            ))} 
          
         <button>Add New</button>
        </React.Fragment>
      
    );
} 

export default List;
